import React from 'react'
import Card from '../components/Card'

const colors = ['red', 'black', 'purple']

const Deck = () => {
  return (
    <div>
      {
        colors.map((val, index) => (
          <Card img={''} title={val} />
        ))
      }
    </div>
  )
}

export default Deck
